func shift2048(in []uint64, sf int) int {
	var sfI int = sf / 64
	var sfR int = sf % 64
	var mask uint64 = (uint64(1) << uint(sfR)) - 1
	var bits int = (64 - sfR)
	var res uint64
	if sfI == 1 {
		val := in[0]
		for k := 0; k < 31; k++ {
			in[k] = in[k+1]
		}
		in[31] = val
	}
	res = (in[0] & mask) << uint(bits)
	for k := 0; k < 31; k++ {
		var val uint64 = (in[k+1] & mask) << uint(bits)
		in[k] = (in[k] >> uint(sfR)) + val
	}
	in[31] = (in[31] >> uint(sfR)) + res
	return 0
}

func getbitpos(input []uint64, pos uint64) uint64 {
	xi := pos / 64
	xr := pos % 64
	return (input[xi] >> xr) & 0x1
}

func sysgp(input []uint64, output []uint64, pmat []uint32) int {
	var i uint32 = 0
	for k := 0; k < DATALENGTH; k++ {
		var r uint64 = 0
		ki := uint64(k / 64)
		kr := uint(k % 64)
		c := 0
		for x := 0; x < PMTSIZE; x++ {
			val := pmat[i]
			i++
			if val < 2048 {
				r ^= getbitpos(input[:], uint64(val))
				c = c + 1
			}
		}
		if c == 0 {
			r ^= getbitpos(input[:], uint64(k))
			output[ki] |= r << kr
		} else {
			output[ki] |= r << kr
		}
	}
	return 0
}

func scramble(permute_in []uint64, plookup []uint32) {
	var ptbl []uint32
	var permute_out [32]uint64
	for k := 0; k < 64; k++ {
		sf := int(permute_in[0] & 0x7f)
		bs := int(permute_in[31] >> 60)
		ptbl = plookup[bs*2048*4:]
		sysgp(permute_in[:], permute_out[:], ptbl[:])
		shift2048(permute_out[:], sf)
		for k := 0; k < 32; k++ {
			permute_in[k] = permute_out[k]
			permute_out[k] = 0
		}
	}
}

func HashCZZ(header []byte, nonce uint64) []byte {
	var seed [64]byte

	val0 := uint32(nonce & 0xFFFFFFFF)
	val1 := uint32(nonce >> 32)

	for k := 3; k >= 0; k-- {
		seed[k] = byte(val0) & 0xFF
		val0 >>= 8
	}
	for k := 7; k >= 4; k-- {
		seed[k] = byte(val1) & 0xFF
		val1 >>= 8
	}

	for k := 0; k < 32; k++ {
		seed[k+8] = header[k]
	}

	first := hashCZZA(seed[:])

	var permute_in [32]uint64

	for k := 0; k < 8; k++ {
		for x := 0; x < 8; x++ {
			var sft int = x * 8
			val := (uint64(first[k*8+x]) << uint(sft))
			permute_in[k] += val
		}
	}
	for k := 1; k < 4; k++ {
		for x := 0; x < 8; x++ {
			permute_in[k*8+x] = permute_in[x]
		}
	}

	scramble(permute_in[:], tableCZZ[:])

	var dat_in [256]byte
	for k := 0; k < 32; k++ {
		val := permute_in[k]
		for x := 0; x < 8; x++ {
			dat_in[k*8+x] = byte(val & 0xFF)
			val = val >> 8
		}
	}

	for k := 0; k < 64; k++ {
		var temp byte
		temp = dat_in[k*4]
		dat_in[k*4] = dat_in[k*4+3]
		dat_in[k*4+3] = temp
		temp = dat_in[k*4+1]
		dat_in[k*4+1] = dat_in[k*4+2]
		dat_in[k*4+2] = temp
	}

	dgst := sha3.Sum256(dat_in[:])

	return dgst[:]
}

func hashCZZA(b []byte) []byte {
	hash := sha3.Sum512(b)
	for i := 0; i < 32; i++ {
		hash[i], hash[63-i] = hash[63-i], hash[i]
	}
	first := append(hash[:], hash[:]...)
	return append(first, first...)
}

